INSERT INTO `cal_subscribe_event` (`event_id`, `item_id`, `event_status`, `event_name`, `event_address`, `event_description`, `event_icon`, `starttime`, `endtime`, `event_date`, `event_repeat`, `event_time`, `event_type`, `event_order`, `event_url`, `lastupdate`) VALUES
(2, 3, '1', '快乐大本营', '湖南卫视', '《快乐大本营》是湖南电视台于1997年7月11日开办的一档综艺性娱乐节目，目前固定每周六晚黄金时段在湖南卫视播出，是湖南卫视上星以来一直保持的优秀品牌节目。主持人也从开办之初的两人发展到今天全国首创的主持群。栏目开办以来以新鲜的题材，多样的形式，清新的风格，新奇的内容广受好评，注重知识性、趣味性和参与性，引领观众走向一个崭新的视听空间。', '1433926819179666342.jpg', '2015-05-01', '2015-12-31', '6', 'W', '6T2000', 0, 9, '', '0000-00-00 00:00:00'),
(11, 4, '1', '每日运势：白羊座', '', '整体运:★☆☆☆☆\n爱情运:★☆☆☆☆\n事业运:★★☆☆☆\n财　运:★★☆☆☆\n健　康:-\n幸运色:橄榄绿\n幸运数字:4\n速配Ｑ友:射手座\n整体运:\n远离人群找一个安静的地方，想哭就哭，想笑就笑，把所有不快的情绪发泄出来，释放了心中的压抑感，才能重新给自己一个合理的定位。花钱要有所节制，不然花费太大，以免会给日后的生活造成困扰。\n爱情运:\n适合独处、不适合约会、更别妄想情话绵绵，省得谈情说爱不成却惹来口角争执。\n事业运:\n今日事业运不太稳定，成中有败，忙中有错，一切宜谨慎为之。杂事多多时特别要心平气和，是个考验耐力与定力的一天。\n财运:\n宜凭个人才艺赚钱。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(12, 5, '1', '每日运势：金牛座', '', '整体运:★★☆☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★☆☆☆\n幸运色:朝霞红\n幸运数字:7\n速配Ｑ友:双鱼座\n整体运:\n想要找到更好的，却又不愿放弃眼前的他，其实他的付出已经深深感动了你；财运此起彼伏，不知该如何应付的时候会得到贵人相助；工作勤恳令自己很有干劲，发展趋势也相当好，并得到众多同事的认可。\n爱情运:\n恋爱中的人感情在平稳中发展，易感到甜蜜，若能用心经营会有很不错的结果喔！\n事业运:\n今太过顺从他人，很容易妥协，会把自己弄的很累。\n财运:\n出门在外，身上少带现金。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(13, 6, '1', '每日运势：双子座', '', '整体运:★★★★★\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:琥珀橙\n幸运数字:8\n速配Ｑ友:射手座\n整体运:\n内心的平静让你能用平和的心态对待感情，一切顺其自然，倒也能水到渠成；工薪阶层福利待遇可望提高，投资也会有不错收获；显得独断专行，这让身边人敬而远之，要注意加强团体合作。\n爱情运:\n魅力四射的一天，异性缘很好，有许多机会跟异性朋友谈天喝茶。\n事业运:\n今日事业运不错，工作效率颇高，预定之事多能顺利的推动完成。今日很适合扮演军师的角色，所提供的意见多能得到长官的采纳喔！\n财运:\n财运很棒，对于勤劳者特别有利，适合谈判金钱、佣金问题，在积极开发后就会有订单。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(14, 7, '1', '每日运势：巨蟹座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:樱桃红\n幸运数字:6\n速配Ｑ友:天蝎座\n整体运:\n另一半对你会有点鸡蛋里挑骨头的感觉，别急着责备对方，多反省自己才不会引起争执。偏财运良好，财运多在外，赖在家里只会让机遇白白溜走。与同事相处融洽，易得贵人相助。\n爱情运:\n降低闲聊的时间，给对方一点清闲的空间，不要过度干预对方，省得让对方深感不耐烦！\n事业运:\n事业运不错呢！能够开开心心的完成工作，即便小有难题也不会困扰你！\n财运:\n财运顺利，有得财的机会，而且今日对金钱的敏锐度提升，有利于小额投资。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(15, 8, '1', '每日运势：狮子座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:-\n幸运色:金杏橙\n幸运数字:4\n速配Ｑ友:摩羯座\n整体运:\n今天多听他人讨论，不论是八卦还是新闻，都能让你从中获得有利的讯息，对工作有利。有暗恋对象的人，可从旁人的口中获得有关对方的消息，让你充满信心。傍晚运气最旺盛，遇到心仪的对象不妨大胆表白。\n爱情运:\n渴望恋爱，渴望被关心的一天。恋爱中搞些花样来制造生活情趣吧！\n事业运:\n事业运普通，只要抱持喜悦愉快的心情，就能够今日事，今日毕。\n财运:\n投资上比较轻松，即使遇到风险也多能逢凶化吉。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(16, 9, '1', '每日运势：处女座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★★☆\n财　运:★★☆☆☆\n健　康:★★★☆☆\n幸运色:鲑鱼红\n幸运数字:0\n速配Ｑ友:摩羯座\n整体运:\n公众场所不要胡乱发言，本来是无心之说，但尖刻的言词会引起当事人的不满，吵得面红耳赤不但影响自身的形象，更会让人当笑柄。投资方面要谨慎行事，对涉入不深的行业更要多考量。\n爱情运:\n爱情运呈现冷冰冰的状态，少了点甜蜜的感觉。\n事业运:\n思维活跃，策划能力强，利用现有资源进行整合，会有不错的发挥。\n财运:\n不适合投资理财的一天，因为容易收到错误的讯息外，倘若操作错误也容易心生懊悔。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(17, 10, '1', '每日运势：天秤座', '', '整体运:★★☆☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:-\n幸运色:古铜色\n幸运数字:9\n速配Ｑ友:双子座\n整体运:\n过马路时切忌横冲直撞，否则危险系数明显增加。爱美的女性会因销售员的称赞而冲动购买价格不菲的化妆品，造成财运的低落。朋友邀请你去参加派对的机率明显升高，打扮方面若突出你的个性能为你的形象加分，有机会邂逅梦中情人。\n爱情运:\n对另一半别太强势，多了解对方的想法，才能维系良好的夫妻关系唷！\n事业运:\n情绪较低落，容易委屈自己，人前笑口常开，人后却想得较多，易伤心落泪。\n财运:\n赚取清贵之财，此运宜行正道、赚取干净钱。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(18, 11, '1', '每日运势：天蝎座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★☆☆☆\n幸运色:橄榄绿\n幸运数字:8\n速配Ｑ友:摩羯座\n整体运:\n今天情绪比较稳定，情感出现问题的夫妻或情侣可以静下心来与对方深谈，通过沟通你们能找到问题的源头再设法解决；进行面谈的头脑要保持清醒，理智是你的取胜关键；投资理财上切忌跟风，“大趋势”会让你放松警惕，带来的危险、隐患较多。\n爱情运:\n单身者如果不想出门，用电话或E-mail传情也很不错，会与异性聊得很开心喔！\n事业运:\n事务繁多，要加班加点完成任务的机率很高，将要考验到你的体力和毅力。\n财运:\n外出时身上别带太多现金，小心破财。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(19, 12, '1', '每日运势：射手座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:羊毛白\n幸运数字:5\n速配Ｑ友:水瓶座\n整体运:\n今天在感情上有小分歧，不要忽略了恋人的感受，心平气和地沟通，才能让幸福指数增加。工作上运气不错，出门可遇见贵人，途中有困难之处时，能得到旁人的无私相助。颇有偏财运，不妨买乐透碰碰运气。\n爱情运:\n恋爱平平日，有点外力的小干扰，不妨让对方自由一天吧！\n事业运:\n吉星高照，特别是从事文职或者创作工作的人士，心思敏锐，有升职加薪的可能。而业务工作者应加强和老客户互动，亦有不错斩获。\n财运:\n保持乐观的心态，偏财就容易走近你了！\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(20, 13, '1', '每日运势：摩羯座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★☆☆☆\n幸运色:奶油白\n幸运数字:0\n速配Ｑ友:水瓶座\n整体运:\n感情丰富的一天，易回忆起过去的点滴生活，有许多想法。单身者在沉思时最迷人，易获得异性青睐。会有小小的破财，不过敏锐的你又能很快寻找到不错的商机。工作虽然辛苦，却很能激发你工作的潜能。\n爱情运:\n有许多机会与异性朋友谈天说地，单身朋友有机会恋爱；有伴侣的人小心另一半吃醋唷！\n事业运:\n工作过程易遇到突如其来的困难，但你的人际关系和谐，有机会得到同事的援助，能够化险为夷。\n财运:\n财运不稳定的一天，时好时坏，进进出出明显，不适合投机取巧喔！\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(21, 14, '1', '每日运势：水瓶座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:宝石蓝\n幸运数字:4\n速配Ｑ友:巨蟹座\n整体运:\n今天头脑灵活，很有主见，对独立作业者特别有利，因判断准确，速战速决而有突出的表现。不过，在与人交往时会不经意地摆出高高在上的姿态，评价他人也会过于主观，影响人际关系，要多留意自己的言行。\n爱情运:\n外界干扰很多，在心浮气躁之下，也没什么心思去想感情的问题啰！\n事业运:\n精神抖擞，感觉浑身的细胞都在跳跃，对工作充满热情和期望，会使办事效率提高不少，并忽视许多压力。\n财运:\n疑心病重不轻易相信他人的提议，坚持己见，时而丧失赚钱的契机。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(22, 15, '1', '每日运势：双鱼座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:奶油白\n幸运数字:1\n速配Ｑ友:狮子座\n整体运:\n在独处时容易回忆起过去的点点滴滴，想到旧情人时会特别感伤。对投资有着独特的嗅觉，能看清当前的形势，把握时机，迅速行动。工作上会出现沟通不良而产生误会的情形，面见客户最好能亲自接见，以免传达错误。\n爱情运:\n已婚者遇到困难不妨多与另一半商量，易得到援助；单身者保持微笑可提升桃花运。\n事业运:\n想要奋力向前冲，但有些力不从心。与其硬着头皮向前，不如停下脚步重新调整前进步伐，欲速则不达！\n财运:\n投资方面不够果断，容易贻误商机，\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(23, 4, '1', '每日运势：白羊座', '', '整体运:★☆☆☆☆\n爱情运:★☆☆☆☆\n事业运:★★☆☆☆\n财　运:★★☆☆☆\n健　康:-\n幸运色:橄榄绿\n幸运数字:4\n速配Ｑ友:射手座\n整体运:\n远离人群找一个安静的地方，想哭就哭，想笑就笑，把所有不快的情绪发泄出来，释放了心中的压抑感，才能重新给自己一个合理的定位。花钱要有所节制，不然花费太大，以免会给日后的生活造成困扰。\n爱情运:\n适合独处、不适合约会、更别妄想情话绵绵，省得谈情说爱不成却惹来口角争执。\n事业运:\n今日事业运不太稳定，成中有败，忙中有错，一切宜谨慎为之。杂事多多时特别要心平气和，是个考验耐力与定力的一天。\n财运:\n宜凭个人才艺赚钱。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(24, 5, '1', '每日运势：金牛座', '', '整体运:★★☆☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★☆☆☆\n幸运色:朝霞红\n幸运数字:7\n速配Ｑ友:双鱼座\n整体运:\n想要找到更好的，却又不愿放弃眼前的他，其实他的付出已经深深感动了你；财运此起彼伏，不知该如何应付的时候会得到贵人相助；工作勤恳令自己很有干劲，发展趋势也相当好，并得到众多同事的认可。\n爱情运:\n恋爱中的人感情在平稳中发展，易感到甜蜜，若能用心经营会有很不错的结果喔！\n事业运:\n今太过顺从他人，很容易妥协，会把自己弄的很累。\n财运:\n出门在外，身上少带现金。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(25, 6, '1', '每日运势：双子座', '', '整体运:★★★★★\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:琥珀橙\n幸运数字:8\n速配Ｑ友:射手座\n整体运:\n内心的平静让你能用平和的心态对待感情，一切顺其自然，倒也能水到渠成；工薪阶层福利待遇可望提高，投资也会有不错收获；显得独断专行，这让身边人敬而远之，要注意加强团体合作。\n爱情运:\n魅力四射的一天，异性缘很好，有许多机会跟异性朋友谈天喝茶。\n事业运:\n今日事业运不错，工作效率颇高，预定之事多能顺利的推动完成。今日很适合扮演军师的角色，所提供的意见多能得到长官的采纳喔！\n财运:\n财运很棒，对于勤劳者特别有利，适合谈判金钱、佣金问题，在积极开发后就会有订单。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(26, 7, '1', '每日运势：巨蟹座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:樱桃红\n幸运数字:6\n速配Ｑ友:天蝎座\n整体运:\n另一半对你会有点鸡蛋里挑骨头的感觉，别急着责备对方，多反省自己才不会引起争执。偏财运良好，财运多在外，赖在家里只会让机遇白白溜走。与同事相处融洽，易得贵人相助。\n爱情运:\n降低闲聊的时间，给对方一点清闲的空间，不要过度干预对方，省得让对方深感不耐烦！\n事业运:\n事业运不错呢！能够开开心心的完成工作，即便小有难题也不会困扰你！\n财运:\n财运顺利，有得财的机会，而且今日对金钱的敏锐度提升，有利于小额投资。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(27, 8, '1', '每日运势：狮子座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:-\n幸运色:金杏橙\n幸运数字:4\n速配Ｑ友:摩羯座\n整体运:\n今天多听他人讨论，不论是八卦还是新闻，都能让你从中获得有利的讯息，对工作有利。有暗恋对象的人，可从旁人的口中获得有关对方的消息，让你充满信心。傍晚运气最旺盛，遇到心仪的对象不妨大胆表白。\n爱情运:\n渴望恋爱，渴望被关心的一天。恋爱中搞些花样来制造生活情趣吧！\n事业运:\n事业运普通，只要抱持喜悦愉快的心情，就能够今日事，今日毕。\n财运:\n投资上比较轻松，即使遇到风险也多能逢凶化吉。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(28, 9, '1', '每日运势：处女座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★★☆\n财　运:★★☆☆☆\n健　康:★★★☆☆\n幸运色:鲑鱼红\n幸运数字:0\n速配Ｑ友:摩羯座\n整体运:\n公众场所不要胡乱发言，本来是无心之说，但尖刻的言词会引起当事人的不满，吵得面红耳赤不但影响自身的形象，更会让人当笑柄。投资方面要谨慎行事，对涉入不深的行业更要多考量。\n爱情运:\n爱情运呈现冷冰冰的状态，少了点甜蜜的感觉。\n事业运:\n思维活跃，策划能力强，利用现有资源进行整合，会有不错的发挥。\n财运:\n不适合投资理财的一天，因为容易收到错误的讯息外，倘若操作错误也容易心生懊悔。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(29, 10, '1', '每日运势：天秤座', '', '整体运:★★☆☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:-\n幸运色:古铜色\n幸运数字:9\n速配Ｑ友:双子座\n整体运:\n过马路时切忌横冲直撞，否则危险系数明显增加。爱美的女性会因销售员的称赞而冲动购买价格不菲的化妆品，造成财运的低落。朋友邀请你去参加派对的机率明显升高，打扮方面若突出你的个性能为你的形象加分，有机会邂逅梦中情人。\n爱情运:\n对另一半别太强势，多了解对方的想法，才能维系良好的夫妻关系唷！\n事业运:\n情绪较低落，容易委屈自己，人前笑口常开，人后却想得较多，易伤心落泪。\n财运:\n赚取清贵之财，此运宜行正道、赚取干净钱。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(30, 11, '1', '每日运势：天蝎座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★☆☆☆\n幸运色:橄榄绿\n幸运数字:8\n速配Ｑ友:摩羯座\n整体运:\n今天情绪比较稳定，情感出现问题的夫妻或情侣可以静下心来与对方深谈，通过沟通你们能找到问题的源头再设法解决；进行面谈的头脑要保持清醒，理智是你的取胜关键；投资理财上切忌跟风，“大趋势”会让你放松警惕，带来的危险、隐患较多。\n爱情运:\n单身者如果不想出门，用电话或E-mail传情也很不错，会与异性聊得很开心喔！\n事业运:\n事务繁多，要加班加点完成任务的机率很高，将要考验到你的体力和毅力。\n财运:\n外出时身上别带太多现金，小心破财。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(31, 12, '1', '每日运势：射手座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:羊毛白\n幸运数字:5\n速配Ｑ友:水瓶座\n整体运:\n今天在感情上有小分歧，不要忽略了恋人的感受，心平气和地沟通，才能让幸福指数增加。工作上运气不错，出门可遇见贵人，途中有困难之处时，能得到旁人的无私相助。颇有偏财运，不妨买乐透碰碰运气。\n爱情运:\n恋爱平平日，有点外力的小干扰，不妨让对方自由一天吧！\n事业运:\n吉星高照，特别是从事文职或者创作工作的人士，心思敏锐，有升职加薪的可能。而业务工作者应加强和老客户互动，亦有不错斩获。\n财运:\n保持乐观的心态，偏财就容易走近你了！\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(32, 13, '1', '每日运势：摩羯座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★☆☆☆\n幸运色:奶油白\n幸运数字:0\n速配Ｑ友:水瓶座\n整体运:\n感情丰富的一天，易回忆起过去的点滴生活，有许多想法。单身者在沉思时最迷人，易获得异性青睐。会有小小的破财，不过敏锐的你又能很快寻找到不错的商机。工作虽然辛苦，却很能激发你工作的潜能。\n爱情运:\n有许多机会与异性朋友谈天说地，单身朋友有机会恋爱；有伴侣的人小心另一半吃醋唷！\n事业运:\n工作过程易遇到突如其来的困难，但你的人际关系和谐，有机会得到同事的援助，能够化险为夷。\n财运:\n财运不稳定的一天，时好时坏，进进出出明显，不适合投机取巧喔！\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(33, 14, '1', '每日运势：水瓶座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:宝石蓝\n幸运数字:4\n速配Ｑ友:巨蟹座\n整体运:\n今天头脑灵活，很有主见，对独立作业者特别有利，因判断准确，速战速决而有突出的表现。不过，在与人交往时会不经意地摆出高高在上的姿态，评价他人也会过于主观，影响人际关系，要多留意自己的言行。\n爱情运:\n外界干扰很多，在心浮气躁之下，也没什么心思去想感情的问题啰！\n事业运:\n精神抖擞，感觉浑身的细胞都在跳跃，对工作充满热情和期望，会使办事效率提高不少，并忽视许多压力。\n财运:\n疑心病重不轻易相信他人的提议，坚持己见，时而丧失赚钱的契机。\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
(34, 15, '1', '每日运势：双鱼座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:奶油白\n幸运数字:1\n速配Ｑ友:狮子座\n整体运:\n在独处时容易回忆起过去的点点滴滴，想到旧情人时会特别感伤。对投资有着独特的嗅觉，能看清当前的形势，把握时机，迅速行动。工作上会出现沟通不良而产生误会的情形，面见客户最好能亲自接见，以免传达错误。\n爱情运:\n已婚者遇到困难不妨多与另一半商量，易得到援助；单身者保持微笑可提升桃花运。\n事业运:\n想要奋力向前冲，但有些力不从心。与其硬着头皮向前，不如停下脚步重新调整前进步伐，欲速则不达！\n财运:\n投资方面不够果断，容易贻误商机，\n', NULL, '2015-05-01', '2015-12-31', 'qvZa4uc', 'N', '20150611T0900', 0, 9, '', '0000-00-00 00:00:00'),
