(318, 4, '1', '每日运势：白羊座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★★★★\n健　康:★★★☆☆\n幸运色:浅莲红\n幸运数字:6\n速配Ｑ友:天蝎座\n整体运:\n心情好坏对方一看便知，别把心事藏在心里，说出来问题才更好解决；与合作伙伴配合再紧密些，财运突破最高点的时机就在眼前喔！把工作暂时先放一放，太重视兼顾反而转变成两头耽误。\n爱情运:\n单身者有心仪的对象不妨大胆表白，运势佳，成功的机率高。\n事业运:\n事业运普通，会扮演配合听话的角色，依规行事。不妨趁着午间休息去外面绕两圈，释放一下压力吧！\n财运:\n吉星、福星高照的日子，金钱上有锦上添花的机缘，得财不费力，多么令人羡慕的运气！还有小小的赌运唷。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
