(297, 4, '1', '每日运势：白羊座', '', '整体运:★★★☆☆\n爱情运:★★★☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★★☆☆☆\n幸运色:青金石蓝\n幸运数字:8\n速配Ｑ友:天秤座\n整体运:\n不要一时口快伤害了他人的自尊心，犯了错误要勇于道歉，容易得到他人的谅解。为了增强友谊而花费一部分钱财，没有必要心疼。别人把隐私告诉你，只要当好一个倾听着就好，不要胡乱出馊主意，也不可宣扬出去。\n爱情运:\n恋爱中的人想有个温暖的家，结婚的念头愈加强烈，但现在不是最好时机，还需耐心等待！\n事业运:\n求职者要拿出很有信心的气势来，面试时不妨将以前好成绩或表扬有针对性的重点描述，会为自己的整体形象加不少分。\n财运:\n应理性购物，贵的东西不一定是最好的。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(298, 5, '1', '每日运势：金牛座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:樱桃红\n幸运数字:3\n速配Ｑ友:巨蟹座\n整体运:\n各样桃花会不期而遇，沉浸在喜悦当中，不过也别忘记及时做出选择哦；财运良好，但犹犹豫豫会妨碍你的判断力，必要时还应做出果断的决定，财富才不会离你远去；工作中你会遇上一些困难，相信自己，今天是个彰显才能的好时机。\n爱情运:\n单身者有机会因帮助异性共事而有恋爱的机缘；有伴侣的人关系和谐，让人羡慕。\n事业运:\n应好好运用超强的行动力，只要是可行的方案都可以试着尝试，会有意想不到的效果。\n财运:\n适合规划记帐的一天，仔细观察帐本，检讨调整花钱的习惯。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(299, 6, '1', '每日运势：双子座', '', '整体运:★★☆☆☆\n爱情运:★☆☆☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★☆☆☆\n幸运色:浅莲红\n幸运数字:9\n速配Ｑ友:巨蟹座\n整体运:\n情感遇到小挫折，对方的不理解让你渐渐犹豫，有种想放弃的感觉。投资之路颇为顺利，所遇之人均能为你指引出不错的赚钱之路，但需把握利弊趋势。工作遇到获得不错的学习机会，而且同事间的情谊让你乐在其中。\n爱情运:\n恋爱运不太好，恋爱中人特别容易动怒生气或是为情伤神，转移注意力不要太偏激啰！\n事业运:\n工作受人关注，不要有任何心理压力，理清头绪就可以出色地完成。\n财运:\n易因思虑不周而破财。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(300, 7, '1', '每日运势：巨蟹座', '', '整体运:★☆☆☆☆\n爱情运:★☆☆☆☆\n事业运:★☆☆☆☆\n财　运:★★★☆☆\n健　康:-\n幸运色:月光蓝\n幸运数字:3\n速配Ｑ友:白羊座\n整体运:\n在异性面前吹牛，会有被对方揭底的危险，还是实事求是的好。对信息资料的理性分析，今天可派上用场，在投资上将有不错的收益。切忌在工作时间研究理财产品，会有小人告密而受到批评的危险。\n爱情运:\n不安宁的一天，情况有点糟，想办法善后，不要继续胡闹！\n事业运:\n事业运不佳，容易发生事与愿违的情形，少说点话多做事，自可远离是是非非。\n财运:\n理财主观性颇强，宜以守代攻！\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(301, 8, '1', '每日运势：狮子座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★☆☆☆☆\n健　康:★★★☆☆\n幸运色:宝石蓝\n幸运数字:6\n速配Ｑ友:天秤座\n整体运:\n花很多心思想要给另一半惊喜，却易被对方泼冷水，应注意方式方法。工作中勇于承担重任，但不易接受援助，孤军奋战容易陷于被动。今天敛财不是时机，还是把心思放在工作上才好。\n爱情运:\n单身者容易因为异性的关心而快速投入一段感情；已婚者易陷入感情纠纷。\n事业运:\n任何问题都想靠自身的能力独立解决，不愿意接受来自周围人的好意。\n财运:\n金钱上不太如意，得失心也会重一点，所以不要轻易尝试高风险的金钱游戏。破财时看开一点。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(302, 9, '1', '每日运势：处女座', '', '整体运:★★★★★\n爱情运:★★★☆☆\n事业运:★★★★☆\n财　运:★★★★★\n健　康:★★★★☆\n幸运色:草根白\n幸运数字:6\n速配Ｑ友:双鱼座\n整体运:\n今天你说出来的话特别有影响力，同事、朋友都愿意听你的，一些高难度的工作都可以做好。特别有创意，适合给他人出谋划策。不过，在感情上显得较强势，希望伴侣事事顺从你，会让对方有压力喔！\n爱情运:\n恋爱运普通，保持笑容、眼神柔和点才能让爱情运加温。\n事业运:\n事业运还不错，动动你的脑筋，或许会有出乎意料的创意出现。\n财运:\n偏财运旺旺日，适合小赌一番！业务、生意人多接见客户，或许会有从天而降的机会唷！\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(303, 10, '1', '每日运势：天秤座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:玉米黄\n幸运数字:4\n速配Ｑ友:天秤座\n整体运:\n婚姻生活不如预期所想，有种难解的失落感。偏财运颇好，商铺经营者在下午二点至六点可望迎来财运高峰期，进财颇多。工作积极性高，理性对待朋友们所提出的建议，助自己的事业蒸蒸日上。\n爱情运:\n有这么严重吗，不过就是小事！想点彼此开心甜蜜的事情吧！\n事业运:\n需积极寻求发展机会，机会蕴藏在琐事中，不怕麻烦者可得幸福女神眷顾。\n财运:\n有额外的进财机会，别顾虑太多，以免错过机会。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(304, 11, '1', '每日运势：天蝎座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:-\n幸运色:嫩芽绿\n幸运数字:2\n速配Ｑ友:水瓶座\n整体运:\n今天会有被人簇拥的优越感，平时不喜欢亲近你的人也很乐意与你接触，让你受宠若惊。千万别飘飘然，冷静下来好好利用人脉，工作会比预计更顺利。财运颇优，先前的投资计划可在今天落实。\n爱情运:\n活耀的一天，穿得美美帅帅的再出门，因为今天的你特别容易引人注目。\n事业运:\n事业运普通，适合一个人独处，冷静的做分析推理的工作。\n财运:\n金钱难题今日可望获得解决，遇到困难时，只要多用智慧、条件交换不难找到金援者。贵人来自于长辈与老朋友。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(305, 12, '1', '每日运势：射手座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:水晶紫\n幸运数字:9\n速配Ｑ友:狮子座\n整体运:\n苦心经营的感情有破裂的危险，还好最终理智战胜冲动，矛盾也有机会得以化解。财运佳，争取经费、申请贷款等会很顺利。学习热忱高涨，干劲十足，再加上不错的贵人缘，学习效率颇高。\n爱情运:\n情绪有点不稳定咧，不要碎碎念不停，否则情人会发飙的。\n事业运:\n在实施计划的途中，看似困难重重，实则充满契机，不放弃，坚持下去就会看到希望。\n财运:\n暗财运弱，正大光明的赚钱实际些！\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(306, 13, '1', '每日运势：摩羯座', '', '整体运:★★★☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:★★☆☆☆\n幸运色:宝石蓝\n幸运数字:6\n速配Ｑ友:天秤座\n整体运:\n工作上稍微偷懒一点，按照上司的安排工作反而容易受到好评；今天干脆就让自己轻松一点吧，不是必要的约会就取消好了，给自己多点时间；静下心，学习专业知识，会让整个人充实。\n爱情运:\n已婚者感情生活平顺，过着两小无猜的日子；单身者与异性接触较频繁，相处愉快。\n事业运:\n沉迷于他人的夸赞与奉承之中，也因此对工作有所疏忽，易在关键时刻出错。\n财运:\n积极进取者易得财神眷顾，进帐可观。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(307, 14, '1', '每日运势：水瓶座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:茄皮紫\n幸运数字:4\n速配Ｑ友:摩羯座\n整体运:\n别把工作当成儿戏，一不留神就会出现差错，补救工作会花费更多精力。感情易有波澜，在恋人面前太过随意，满口脏话的行为会让对方感觉不舒服，别贪图一时的口舌之快才好。\n爱情运:\n单身者多与异性朋友联络，聊聊心事；恋爱中的人很依赖恋人，让对方感觉被需要。\n事业运:\n意志消沉，缺乏奋斗的欲望，做事时容易分神而差错百出。\n财运:\n金钱流动性较强，有左进右出的迹象，而且今天你对金钱比较计较，得失心有点重唷！\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
(308, 15, '1', '每日运势：双鱼座', '', '整体运:★★★★☆\n爱情运:★★★★★\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:浅桔黄\n幸运数字:2\n速配Ｑ友:天秤座\n整体运:\n大小桃花纷至沓来，让你有些应接不暇，可不要挑花眼哦！朋友们的投资日见成效，看得你相当眼红，投资热情不断高涨；浅尝辄止的学习作风今天会让你的收获同样微薄，转变想法才有望实现突破。\n爱情运:\n感情超级丰富的一天，很容易受感动！单身者稍微有异性对你好一点你就被电到啰！\n事业运:\n作上有好消息降临，让你兴奋不已。正是发挥才能的时期，好好把握机会吧！\n财运:\n花钱应量入为出。\n', NULL, '2015-05-01', '2015-12-31', 'qw8DuSI', 'N', '20150625T0900', 0, 9, '', '0000-00-00 00:00:00'),
