(319, 5, '1', '每日运势：金牛座', '', '整体运:★☆☆☆☆\n爱情运:★★☆☆☆\n事业运:★☆☆☆☆\n财　运:★☆☆☆☆\n健　康:-\n幸运色:璀璨紫\n幸运数字:7\n速配Ｑ友:天蝎座\n整体运:\n夫妻感情易出现裂痕，少与另一半争辩，让父母长辈出面可扭转局面；单身者恋爱运不佳，多把微笑挂在脸上可有所改善。财运较弱，在与他人有金钱往来时，需留意票据是否齐全，以免引起钱财纠纷。\n爱情运:\n感情问题慢慢浮上台面，若能摆正心态，积极处理，自可安然度过难关。\n事业运:\n事业运很背，不宜轻举妄动，也别做任何重大的决定，以免判断错误外还有破坏职场上的和谐度。\n财运:\n宜将心力放在正财，免得投机不成又赔了心情。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(313, 22, '1', '历史上的今天7月8日', '', '1621年 法国作家拉封丹诞辰\n1839年 标准石油公司创始人洛克菲勒出生\n1867年 珂勒惠支诞生，德国版画家、雕刻家\n1891年 中国现代中国画家胡佩衡出生\n1904年 法国数学家埃利·约瑟夫·嘉当出生。\n1937年 日本漫画家永岛慎二出生\n1957年 台湾政治人物王家贞出生\n1967年 日本动画声优大西健晴出生。\n1967年 香港歌手及演员陈小春出生。\n1969年 香港演员及主持人陈芷菁出生\n', NULL, '2015-07-08', '2015-07-08', 'qx2O5Nu', 'N', '20150708T0900', 0, 9, '', '0000-00-00 00:00:00'),
(314, 22, '1', '历史上的今天7月9日', '', '1249年 日本天皇龟山天皇出生\n1701年 法国路易十五，路易十六时代的政治人物让-弗雷德里克·菲利波出生。\n1781年 乔治·史蒂芬逊诞生，火车的发明人。\n1791年 德国图书馆学家弗里德里希·阿道夫·艾伯特诞生。\n1843年 戈尔季诞生，神经组织学家和病理学家。\n1847年 中国武术家黄飞鸿出生\n1858年 美国人类学家法兰兹·鲍亚士诞生。\n1888年 现代出版家、商务印书馆总经理王云五出生。\n1894年 苏联物理学家彼得·卡皮查出生\n1911年 美国著名的物理学家约翰·阿奇博尔德·惠勒出生。\n', NULL, '2015-07-09', '2015-07-09', 'qx3u3fO', 'N', '20150709T0900', 0, 9, '', '0000-00-00 00:00:00'),
(320, 6, '1', '每日运势：双子座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:-\n幸运色:羊毛白\n幸运数字:6\n速配Ｑ友:双鱼座\n整体运:\n单身者接触异性骤然增多，使你有些眼花缭乱，有些抑制不住内心的喜悦。工作上的财运较普通，工作认真努力则可获得额外金钱奖励。财运上比较不错，过往投资有回报的机会，切不可过于贪心。\n爱情运:\n今日你们的恋情如文火，不会熄灭，也不会轰轰烈烈；如茶水，平平淡淡。如果想要拥有情趣昂然的感觉，需要你们挥出潜伏着的热情。\n事业运:\n事业运普通，一分耕耘一分收获。今日重点在于沟通协调方面，不妨趁今日与客户或同事沟通联系一番。\n财运:\n财运普通，出门玩乐特别容易把钱花光光喔！\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
