(321, 7, '1', '每日运势：巨蟹座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★★☆\n健　康:★★★☆☆\n幸运色:月光蓝\n幸运数字:5\n速配Ｑ友:双鱼座\n整体运:\n你对另一半表现得太过强势、压迫，容易导致与他难以相互调适而使感情出现问题；你的自负任性会让上司、同事觉得你对他们不尊重，对你的好感急剧下降；投资上在得到专业人事的帮助下做出全面、周全的理财方案能得到很好效果\n爱情运:\n想表白？我看还是改天吧，胜算太低了。\n事业运:\n与上司或同事意见不统一时，言语会比较强硬，惹来误会。\n财运:\n有机会收到礼物，感觉温馨惬意。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(322, 8, '1', '每日运势：狮子座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★☆☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:浅莲红\n幸运数字:5\n速配Ｑ友:射手座\n整体运:\n今天小小贴心的举动会提升自己的财运，记得帮助你身边的人，他们会给你理财上的提示哦；工作上有些开小差，若不及早打起精神，有被上司训话的可能；爱情际遇不高，不宜在今天表白。\n爱情运:\n与异性接触的机会多，但仅止于工作关系，想恋爱还得耐心等待一段时间。\n事业运:\n事业运不佳，心理有点委屈，觉得被同事或长官压榨。负面情绪太多时会让你的工作绩效大大打折扣喔！\n财运:\n适当克制自己的购物欲望。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(323, 9, '1', '每日运势：处女座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★★☆☆\n幸运色:香槟金\n幸运数字:5\n速配Ｑ友:狮子座\n整体运:\n今天你不愿孤单，好好的装扮自己，约中意的对象来一场约会吧。投资上比较懒散，不肯花费精力去查阅资料，小心因此而损财。工作上还算好，虽然有突发状况，但能随机应变，妥善处理。\n爱情运:\n只许州官放火，不许百姓点灯，太鸭霸会使双方陷入不愉快的窘境。\n事业运:\n会感觉到一些压力，不过，做事时注意认准方向，细心一些，就能轻松过关。\n财运:\n在金钱上易犯迷糊，不宜交易\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(324, 10, '1', '每日运势：天秤座', '', '整体运:★★★★★\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:古铜色\n幸运数字:6\n速配Ｑ友:处女座\n整体运:\n说起话来滔滔不绝，而且尽显风趣幽默的一面，能很快活跃气氛，男女老少皆欢喜，单身者有机会与谈话投机的异性结缘。经商者有机会接触到贤能之士，是学习经验、提升自我的日子。\n爱情运:\n恋爱运势还不错，想要恋爱的人可以请长辈撮合。恋爱中人用点小技巧逗逗对方吧！\n事业运:\n如果和价格或薪水有关的话今天就免谈吧，其它事倒好与客户或上司商量。\n财运:\n有意外的惊喜，例如：中奖、收红包、拿礼物等等！\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(325, 11, '1', '每日运势：天蝎座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:钻石蓝\n幸运数字:1\n速配Ｑ友:金牛座\n整体运:\n今天在异性面前显得有些迟钝，连说话都会有些不自然，尽量少与异性单独相处，以免破坏先前所树立的良好形象；投资理财易得贵人暗中相助，默默接受对方的好意就好，不可四处张扬哦！\n爱情运:\n另一半可能会遇到一些烦心事，对你叨唸不必生气，此时理解与体谅显得尤为重要。\n事业运:\n虽然会遇到一些困难，但你显得乐观，能以正面的心态去面对问题。\n财运:\n赚取不法之财，否则引来官非则饭碗不保！\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(326, 12, '1', '每日运势：射手座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:苔藓绿\n幸运数字:9\n速配Ｑ友:水瓶座\n整体运:\n刚入职的人在前辈面前要受一些委屈，调整好心态，做事时尽量完善一些；客服工作者要特别注意自己的态度，语气稍重的一句话都有可能遭到客户投诉；单身者有被父母念的烦恼，一个人呆着时反而觉得一身轻松。\n爱情运:\n单身者有意外邂逅良缘的机运；已婚者感情融洽，有机会一起旅游。\n事业运:\n颇具冒险精神，很有干劲，但运势不佳，执行计划还应多听听前辈意见。\n财运:\n太依赖直觉行事，欠缺客观讯息会导致财物损失。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(327, 13, '1', '每日运势：摩羯座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:苹果绿\n幸运数字:5\n速配Ｑ友:天蝎座\n整体运:\n单身者易在酒吧、舞厅等娱乐场所遇到让自己着迷的异性；炒股的人不要只盯着家里的电脑屏幕，去证券市场看看会收获更多行情和新资讯；工作比较马虎，虽然不至于对公司造成严重损失，但留给上司和同事的印象不太好。\n爱情运:\n已婚者少在约会时谈工作，小心把气氛弄糟；单身者多参加娱乐活动，有机会发生新恋情。\n事业运:\n努力克制你的鲁莽和冲动，做决定前尽量征求他人意见，集思广益比自己一意孤行要好。\n财运:\n想赚钱又怕担风险，经商者在没有把握时不妨多请教高人，或者谋求有经验的合作伙伴。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(328, 14, '1', '每日运势：水瓶座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★★\n财　运:★★★☆☆\n健　康:★★★★★\n幸运色:火焰红\n幸运数字:1\n速配Ｑ友:摩羯座\n整体运:\n今天与另一半沟通较深入，因聊到彼此都感兴趣的话题，气氛非常活跃，感觉有说不完的话。理财小有斩获，日常的累积在今天发挥功效。工作方面，别嫌工作太繁琐，耐得住性子会很有收获。\n爱情运:\n出门前搞点特殊的小配件在身上，能提升爱情运唷！\n事业运:\n事业运颇优，心情快乐之下工作绩效特别好，而且耐心、耐力、脑力也不错唷！\n财运:\n金钱运作上特别大胆有魄力，虽然有远大的眼光，但必须仔细评估后才可以有动作喔！\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(329, 15, '1', '每日运势：双鱼座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:★★☆☆☆\n幸运色:石板灰\n幸运数字:6\n速配Ｑ友:处女座\n整体运:\n情人的心意让你有些捉摸不定，让你多次产生放弃的念头，今天是个好时机，不妨把想法说出来吧！财运良好，今天会有种立竿见影的感觉。工作热情较高，但缺乏机遇，埋头苦干时还需留意身边的变化。\n爱情运:\n双方的相处上有点问题，除了意见不合外，也要注意不要把工作上的负面情绪迁怒在对方身上喔！\n事业运:\n工作上冲劲十足，很爱表现自己，但也显得过于争强好胜，容易引起同事的反感，提醒自己收敛些才好。\n财运:\n容易获得异性金援，别错过机会。\n', NULL, '2015-07-22', '2015-07-22', 'qxchwc0', 'N', '20150722T0900', 0, 9, '', '0000-00-00 00:00:00'),
(330, 4, '1', '每日运势：白羊座', '', '整体运:★★★☆☆\n爱情运:★★★☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★★☆☆☆\n幸运色:马鞍棕\n幸运数字:0\n速配Ｑ友:双鱼座\n整体运:\n出现小错误在所难免，因此要时刻提醒自己不能疏忽大意。在办公桌上放一盆植物，多看看它会有安神醒脑的作用。空闲时间可以与同事去户外打打球，有助恢复精力。\n爱情运:\n单身者有机会与心灵相通的异性交往，多制造神秘感和意外惊喜，很容易吸引对方喔！\n事业运:\n工作中夹杂着错愕、机会与烦恼，对事情的把握度不强，事故重复出现的指数较高，常在同一地方摔倒两次或两次以上。\n财运:\n有时间不妨多充电，阅读一些理财方面的书籍。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(331, 5, '1', '每日运势：金牛座', '', '整体运:★★☆☆☆\n爱情运:★★★☆☆\n事业运:★★☆☆☆\n财　运:★★☆☆☆\n健　康:★☆☆☆☆\n幸运色:云母白\n幸运数字:6\n速配Ｑ友:白羊座\n整体运:\n今天做事有些拖泥带水，影响工作进度，若与他人合作容易引起合作伙伴的不满。爱情方面平淡如怡，不会给你带来麻烦。如果条件允许，可联系以前的同学或朋友，一起聚聚，让生活更丰富多彩。\n爱情运:\n单身者喜欢沉浸在被爱的感觉中，但你却不会轻易付出感情，给人游戏爱情的感觉。\n事业运:\n有被人忽略的感觉，付出得不到回报，积极的表现也常被人误会，不要太在意才好。\n财运:\n财运不佳，投资勿贪多，以免分散精力。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(332, 6, '1', '每日运势：双子座', '', '整体运:★☆☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★☆☆☆☆\n健　康:-\n幸运色:玛瑙蓝\n幸运数字:5\n速配Ｑ友:摩羯座\n整体运:\n切忌因个人情绪而全盘否定朋友提出的建议，意见虽不全对，但有其参考的价值，根据自己的实际情况，总能找到一条合适自己的。对另一半有成见，显得有些死心眼，小心到头来受伤的只是自己。\n爱情运:\n有伴侣的人易看到另一半的缺点，千万别因一时口快责骂对方，小心感情受损。\n事业运:\n今日事业不稳定，工作上的运作变化速度快，修修改改的机会特别多，耐着性子是很重要的喔！\n财运:\n财运背背日，有当散财童子的机会，拿点小钱做做人情是无所谓，如果拿去赌博就不太好了。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(333, 7, '1', '每日运势：巨蟹座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:草根白\n幸运数字:9\n速配Ｑ友:双子座\n整体运:\n无心经营感情，另一半的挑剔让你想要逃避；单身者爱幻想，午后出门走走易有不错际遇。面对工作思多行少，希望不像劳而获，时间在空想中一分一秒流失。今天可以花些钱买些装饰品装点房间，会让你心情愉快喔！\n爱情运:\n单身者易获得异性关心，内心温暖；已婚者遇到不开心的事多与另一半交流，易获得释然。\n事业运:\n时机尚未成熟，应先沉潜实力，不可急于求成。\n财运:\n偏财运不错，但不宜过于投机。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(334, 8, '1', '每日运势：狮子座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:★★★☆☆\n幸运色:秋葵绿\n幸运数字:2\n速配Ｑ友:白羊座\n整体运:\n财运不错，今天对市场的把握相当敏锐，正是出手的好时机。工作上和同事的协作能产生好成绩。公园是晚上约会的好地方，夜深人静，漫步湖边，能够让夫妻感情迅速升温，相互产生奇妙的情愫。\n爱情运:\n异性缘很好，单身者有机缘遇到心动的对象；恋爱中人也能有快乐丰富的一天。\n事业运:\n事业运普通，压力会大一点，可别偷懒，愈是偷懒压力就愈大，宜虚心接受上司的安排。\n财运:\n财运不错的一天，只要积极的开发就能有所收获，对于商务、业务、开发工作者影响较大。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(335, 9, '1', '每日运势：处女座', '', '整体运:★★★☆☆\n爱情运:★★★☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★★☆☆☆\n幸运色:石板灰\n幸运数字:3\n速配Ｑ友:白羊座\n整体运:\n加班的机率很大，也将大大影响你的情绪，不过同事的鼓励与支持对你会有不错的助运功效。虽然与另一半相处的时间缩短了，但你的努力，会得到对方的肯定。买个小礼物送给家人，会让彼此都开心。\n爱情运:\n单身者有机会获得稍年长的异性照顾，让你受宠若惊；恋爱中的人感情进展平顺。\n事业运:\n事业运略差，做起事来有点没劲，特别要注意虎头蛇尾或是拖泥带水的办事方式会惹来麻烦。\n财运:\n生意人在投资理财上顾虑较多，业绩有下滑的趋势。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(336, 10, '1', '每日运势：天秤座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★★\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:日光黄\n幸运数字:0\n速配Ｑ友:天蝎座\n整体运:\n今天在工作上很有成就感，自己的构想得到老板的肯定，获得同事羡慕的眼光。单身者的信心不是很足，注意多与异性交流，培养自己的自信心,有助于觅到桃花。偏财运不错，抽奖、乐透等都可以试试，会有意外收获。\n爱情运:\n关心对方固然是好事，如果掌控太紧会令对方吃不消喔！\n事业运:\n事业运很不错，企图心旺盛，对事情充满斗志与热忱，是表现个人专业以及优势的好机会。\n财运:\n投资和积蓄兼顾，金钱为你带来快乐，也为你带来成就感和生活的安全感。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(337, 11, '1', '每日运势：天蝎座', '', '整体运:★★★☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:★★☆☆☆\n幸运色:海军蓝\n幸运数字:1\n速配Ｑ友:双鱼座\n整体运:\n今天你有全力以赴的干劲，非常主动积极，身边的人都难以赶上你的脚步。不过，虽有冲劲，却缺乏思考，效果不佳。进财渠道多，埋头苦干难以把握商机，多与他人互动方可抓住财源。\n爱情运:\n恋爱中的人感情稳定，可谈婚论嫁；单身者有机会与旧情人相遇，再次撞出爱情出火花。\n事业运:\n重点应放在注意控制好自己的情绪，以及与人交往时的语气语调。\n财运:\n财运不错，购物易有好运。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(338, 12, '1', '每日运势：射手座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★★★★☆\n健　康:★★☆☆☆\n幸运色:玫瑰红\n幸运数字:1\n速配Ｑ友:水瓶座\n整体运:\n今日做事不宜操之过急，心平气和地处理手中的事务才会有收获。已婚者在与另一半沟通时别表现出随便的态度，易被另一半误会。有机会收到他人赠送的电影、演唱会、球赛入场券等。\n爱情运:\n情绪不稳定，收起急躁的脾气，免得出口伤人了。\n事业运:\n任务进展到一半会有节外生枝的危险，这种情况多是因自己情绪失控而引起。\n财运:\n财运受到长辈的庇荫，遇到困难不妨找家人商量，问题多能迎刃而解喔！\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(339, 13, '1', '每日运势：摩羯座', '', '整体运:★★☆☆☆\n爱情运:★☆☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:琥珀棕\n幸运数字:4\n速配Ｑ友:白羊座\n整体运:\n今天烂桃花开，单身者参加PARTY时，对于接近自己的异性要多留个心眼，谨防桃色陷阱。财运方面应留意一些中小型投资，能有不错发现。工作上别太急躁，会因一些不该有的失误而受到老板的责备。\n爱情运:\n感情上有一团乱的情形，不是互相吃醋就是互相争个你死我活，别斗气，气坏了就不好了！\n事业运:\n心情在一点点变得浮躁，时时提醒自己要冷静才好，情绪化只会是你生活工作的绊脚石。\n财运:\n胆大心细，投资注意看好大方向！\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(340, 14, '1', '每日运势：水瓶座', '', '整体运:★★★★★\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★★★★\n健　康:★★★★☆\n幸运色:稻草黄\n幸运数字:4\n速配Ｑ友:处女座\n整体运:\n如果爱情再加一点火候，单身者就能获得想要的爱情；不要轻易尝试超出能力范围外的事，否则会让自己吃不消；财运很旺，生意之人今天的口才极佳，很容易说动顾客，激发其购买欲望。\n爱情运:\n恋情急速加温，你的恋情令人羡慕，也容易引来一堆好奇关心者。\n事业运:\n今日脑袋瓜似乎空空的，不太容易专心，会不经意的就神游！被上司逮到不免是一番责备喔！\n财运:\n轻松得财的一天，不用花费太多心力就有收获耶，有中奖、得礼金、分红的机会。\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
(341, 15, '1', '每日运势：双鱼座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★★★★\n幸运色:古铜青\n幸运数字:3\n速配Ｑ友:摩羯座\n整体运:\n早上对你来说是个不错的开始，会有意想不到的奇遇，且形成的磁场强度颇强哦！看看他人的投资小笔记，会从中得到想要的信息；学习强度越大你的热情反而越高，得到的帮助也不少。\n爱情运:\n动动脑筋，花点小钱或亲手制作个礼物送给心上人，他会很感动喔！\n事业运:\n事业运普通，杂事琐事特别的多，只能耐着性子处理啰！别想摸鱼，因为今天没什么摸鱼的机会咧！\n财运:\n今日贪念、物欲、投机欲念比较重，消费欲望大，不妨趁今日满足自己的欲念，总比拿去乱赌好！\n', NULL, '2015-07-23', '2015-07-23', 'qxcXtEk', 'N', '20150723T0900', 0, 9, '', '0000-00-00 00:00:00'),
