(350, 4, '1', '每日运势：白羊座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:日光黄\n幸运数字:7\n速配Ｑ友:白羊座\n整体运:\n今天的运气很不错，是你表现自我能力的好时机，想到的事应放手去做；桃花很旺，有伴的人精心安排约会，可享受罗曼蒂克的情调；投资需放慢脚步，给自己更多的时间思考。\n爱情运:\n应酬较频繁，无暇照顾另一半，会让对方心里不舒服，多给对方拥抱可化解误会。\n事业运:\n责任心很强，能按部就班完成各项任务，但缺少精益求精的精神。\n财运:\n在金钱的花费上较大意，钱财留不住。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(351, 5, '1', '每日运势：金牛座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:钻石蓝\n幸运数字:3\n速配Ｑ友:处女座\n整体运:\n容易受外界影响，稍有不如意就会伤感半天，别一个人哭泣，与伴侣聊聊天心里会舒服很多。心情比较沮丧的时候并不适合帮助别人，因此有同事要你帮忙最好还是委婉拒绝吧。今天适合与伴侣泛舟，对方的温柔会让你开朗起来。\n爱情运:\n单身者有机会遇到有缘人，深入交往还需要在沟通上多费心，趁热打铁才能增进感情。\n事业运:\n工作积极性不高，完全抱着完成任务的想法在工作，这将导致你处理事务的质量偏低。\n财运:\n有点小迷糊，所以容易损失小财。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(352, 4, '1', '每日运势：白羊座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:日光黄\n幸运数字:7\n速配Ｑ友:白羊座\n整体运:\n今天的运气很不错，是你表现自我能力的好时机，想到的事应放手去做；桃花很旺，有伴的人精心安排约会，可享受罗曼蒂克的情调；投资需放慢脚步，给自己更多的时间思考。\n爱情运:\n应酬较频繁，无暇照顾另一半，会让对方心里不舒服，多给对方拥抱可化解误会。\n事业运:\n责任心很强，能按部就班完成各项任务，但缺少精益求精的精神。\n财运:\n在金钱的花费上较大意，钱财留不住。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(353, 5, '1', '每日运势：金牛座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:★☆☆☆☆\n幸运色:钻石蓝\n幸运数字:3\n速配Ｑ友:处女座\n整体运:\n容易受外界影响，稍有不如意就会伤感半天，别一个人哭泣，与伴侣聊聊天心里会舒服很多。心情比较沮丧的时候并不适合帮助别人，因此有同事要你帮忙最好还是委婉拒绝吧。今天适合与伴侣泛舟，对方的温柔会让你开朗起来。\n爱情运:\n单身者有机会遇到有缘人，深入交往还需要在沟通上多费心，趁热打铁才能增进感情。\n事业运:\n工作积极性不高，完全抱着完成任务的想法在工作，这将导致你处理事务的质量偏低。\n财运:\n有点小迷糊，所以容易损失小财。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(354, 6, '1', '每日运势：双子座', '', '整体运:★☆☆☆☆\n爱情运:★☆☆☆☆\n事业运:★☆☆☆☆\n财　运:★★★☆☆\n健　康:-\n幸运色:草根白\n幸运数字:9\n速配Ｑ友:射手座\n整体运:\n在异性面前大肆吹牛，会有被对方揭底的危险哦，还是实事求是的好；对信息资料的分析，今天充分派上用场，在投资上将有小小的收获；今天切忌在工作时间研究理财产品，会有小人告密而受到批评的危险哦。\n爱情运:\n爱情运低落，孤独的感觉布满心头，即便有人伴随在你身边，仍然会觉得距离好遥远。\n事业运:\n今日事业运很背，预计中的事项恐被人改变，整天忙碌却没有实质成效，脑袋瓜稍微闪神就出状况啰！\n财运:\n处理小财手法稳健，然而有过度保守的倾向喔！\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(355, 7, '1', '每日运势：巨蟹座', '', '整体运:★★☆☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★★☆☆\n幸运色:羊毛白\n幸运数字:8\n速配Ｑ友:狮子座\n整体运:\n感情上过于敏感，伴侣易因为你的无端猜疑而感到厌烦，应学着信任对方。控制情绪，小心与人发生口角。工作上有人扯你的后腿，注意多与合作伙伴或共事的人进行协商，及时排除这些潜在的危机。\n爱情运:\n夫妻感情不太和谐，因父母或子女的劝说而有所缓和，责任感增强。\n事业运:\n心态较好，对一些人和事都很看得开，会为你在工作上带来了好人缘，也容易得到他人帮助。\n财运:\n购物少买促销品，以免透支。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(356, 8, '1', '每日运势：狮子座', '', '整体运:★★★☆☆\n爱情运:★★★★☆\n事业运:★★★☆☆\n财　运:★★☆☆☆\n健　康:★★☆☆☆\n幸运色:珊瑚橙\n幸运数字:7\n速配Ｑ友:天蝎座\n整体运:\n嘴巴说个不停，很懂得接过他人的话题，气氛很快会被你说活，也因此受到异性的关注，单身者可望被不错的异性看中。工作能保证进度，但没有明显进步，多利用人际关系上的优势，会有意外收获。\n爱情运:\n有伴侣的人与情人之间很有默契，若能时常制造一些惊喜，感情生活会更富有情趣。\n事业运:\n具有时效性的工作任务较多，需要投入更多的精力，吃苦耐劳者易有收获。\n财运:\n乱花钱的一天，一出门可能就会乱花钱，回到家却搞不清楚钱花到哪而去了。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(357, 9, '1', '每日运势：处女座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:茄皮紫\n幸运数字:6\n速配Ｑ友:摩羯座\n整体运:\n今天不妨多欣赏喜欢的音乐，不仅可让心情柔和，还有增加幸运的功效哦；单人今日则异性缘不佳，最好不要选择告白被拒的可能性很大；工作上虽没什么棘手的事情需要处理，人却容易疲倦。\n爱情运:\n我看还是改天再约会吧，今天的情绪会有些不稳。\n事业运:\n求职运不错，将自己的能力和喜欢定位好，在投简历时才能有的放矢，找到好工作的机率也会比较高。\n财运:\n在投资前要审慎评估利弊。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(358, 10, '1', '每日运势：天秤座', '', '整体运:★★★☆☆\n爱情运:★★☆☆☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:橄榄绿\n幸运数字:8\n速配Ｑ友:水瓶座\n整体运:\n会有朋友以各种借口送给你礼物，或是在背后默默为你解决难题，让你感动不已。已婚者与另一半易有小摩擦，但很快能和好如初，而且还有机会撮合好朋友的一段感情。工作效率高，有如神助。\n爱情运:\n容易生气的一天，另一半在金钱运用上又让你生气了吗，看开点，没那么严重唷！\n事业运:\n表达能力突显，亲和力佳，与人沟通顺畅。适合与客户洽谈业务，或是与老板谈薪资，成功机率高。\n财运:\n以往的投资容易有不错的回报。不过，消费欲望强烈，应把多余的钱财交给贴心人管理！\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(359, 11, '1', '每日运势：天蝎座', '', '整体运:★★★★☆\n爱情运:★★★★☆\n事业运:★★★★☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:深海蓝\n幸运数字:2\n速配Ｑ友:射手座\n整体运:\n智商走强，不管工作如何纷繁复杂，还是能做出令人满意的成绩，众人的好评成了你前进的动力。投资上会有新的局面，找准契机，财源滚滚而来就不在话下。美食面爱好者有机会与恋人大饱口福，享受惬意的生活。\n爱情运:\n单身者有机会在联谊中结识志趣相投的异性朋友，可望深入交往；已婚者感情甜蜜。\n事业运:\n人际关系良好，工作上遇到难题容易得到同事的帮助，让你轻松度过难关。\n财运:\n你对金钱的欲望是那么强大，但行动上的步调太缓慢，要小心因你行动上不够快速而失去了机会。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(360, 12, '1', '每日运势：射手座', '', '整体运:★★☆☆☆\n爱情运:★★★☆☆\n事业运:★★☆☆☆\n财　运:★★★☆☆\n健　康:-\n幸运色:浅莲红\n幸运数字:1\n速配Ｑ友:巨蟹座\n整体运:\n今天较感性，总是会缅怀过去，念及旧日恋人会觉得感伤。投资上的眼光不错，发现新的切入点，不过还是要先做系统分析。工作上容易出现沟通方面的误会，跟客户谈话最好能解释清楚一点，不然可能会让对方误解。\n爱情运:\n单身者会注意身边的每一个人，但行动力稍嫌不足，有喜欢的人应采取主动才好。\n事业运:\n金钱观比较的淡薄，容易受到同事的怂恿花费钱财在请客上。\n财运:\n需要主动争取型的财路。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(361, 13, '1', '每日运势：摩羯座', '', '整体运:★★★☆☆\n爱情运:★★★☆☆\n事业运:★★★☆☆\n财　运:★★★☆☆\n健　康:★★★☆☆\n幸运色:秋葵绿\n幸运数字:7\n速配Ｑ友:射手座\n整体运:\n今天的爱情较平淡，最好能穿得鲜亮一点，这样才益于招到不错的桃花；难得贵人相助，投资太急进易遭遇连带损失，破财且劳神；易遇到小心眼的合作伙伴，对方的挖苦会让你很不是滋味。\n爱情运:\n已婚者双方的意见有点不合，尤其在金钱方面，可别让对方逮到你乱花钱的小尾巴唷！\n事业运:\n容易扫兴的一天，无缘无故被人泼冷水的机率较高，对此不必太过在意。\n财运:\n财运不太好，大钱的损失大多在投机投资上。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(362, 14, '1', '每日运势：水瓶座', '', '整体运:★★★★★\n爱情运:★★★★★\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:-\n幸运色:香槟金\n幸运数字:2\n速配Ｑ友:巨蟹座\n整体运:\n陪心爱的人去吃顿烛光晚餐吧，浓情蜜意的场面，任谁见了都羡慕哦。贵人运较强，出门办事易得到他人帮助，顺利完成，可别忘记了谢恩。买本时尚杂志看看，能够多了解一些外部资讯。\n爱情运:\n变化多端的恋爱日，适合与情人一起去吃吃喝喝玩乐一番。\n事业运:\n今日在事业上必须积极的应对，愈是闪避与会感受到压力，勇敢的面临突发状况，你将会有意外的收获。\n财运:\n为了金钱而忙碌的一天，财运很不错，可是必须辛苦耕耘才能获得。为了赚钱可能需要频繁的与人社交周旋。\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
(363, 15, '1', '每日运势：双鱼座', '', '整体运:★★★★☆\n爱情运:★★★☆☆\n事业运:★★★★☆\n财　运:★★★★☆\n健　康:★★★★★\n幸运色:香槟金\n幸运数字:1\n速配Ｑ友:金牛座\n整体运:\n与异性朋友相处甚欢，不过小心提防三角关系的出现！今天以对外为主的工作如销售、保险理赔等会有不错的进展，绩效突出；正财运佳，但偏财还是敬而远之为好，投资时切忌投机。\n爱情运:\n今日你希望借助外力来增添自己的吸引力，以期得到异性的欢心。殊不知，真正能打动异性的是你的真情实意，而绝不是投机取巧。\n事业运:\n谦虚、热忱的一面突显，工作上有机会得到上司的支持与亲友的助力，可放手去做。\n财运:\n想赚钱的欲望强烈，对于业务工作者特别有利，有机会谈下一笔大生意唷！\n', NULL, '2015-07-28', '2015-07-28', 'qxglgVW', 'N', '20150728T0900', 0, 9, '', '0000-00-00 00:00:00'),
