(4, 4, 1, '白羊座', '', '1433927905444987032.jpg', '1433927957230233188.jpg', '白羊座（Aries），黄道十二星座之第一宫，位于双鱼座之东，金牛座之西，出生日期为阳历3月21日—4月20日。', 9, 1, 0, 0, '0000-00-00 00:00:00'),
(5, 4, 1, '金牛座', '', '1433929286628440877.jpg', '1433929291779498565.jpg', '金牛座（Taurus），是黄道十二宫的第二宫。出生日期为阳历4月20日~5月20日。', 9, 31, 0, 0, '0000-00-00 00:00:00'),
(6, 4, 1, '双子座', '', '1433929479659332582.jpg', '1433929479718361803.jpg', '双子座（Gemini），出生日期为5月21日—6月21日，是黄道十二宫里的第三宫，代表了多变、沟通。', 9, 123, 0, 0, '0000-00-00 00:00:00'),
(7, 4, 1, '巨蟹座', '', '1433929642490541537.jpg', '1433929642635862630.jpg', '巨蟹座（Cancer），是夏天开始的第一个星座。出生日期为6月22日—7月22日。位于双子座之东，狮子座之西。', 9, 65, 0, 0, '0000-00-00 00:00:00'),
(8, 4, 1, '狮子座', '', '1433929728446591664.jpg', '1433929728548287558.jpg', '狮子座（Leo ），是黄道十二宫之第五宫，出生日期7月23日至8月22日为狮子座。狮子宫的符号为♌，代表狮子的头,身体和尾巴。', 9, 45, 0, 0, '0000-00-00 00:00:00'),
(9, 4, 1, '处女座', '', '1433929885117200482.jpg', '1433929885250539344.jpg', '处女座（virgo），出生日期为8月23日~9月22日。在狮子座之东，天秤座之西。是黄道十二宫的第六宫。', 9, 1, 0, 0, '0000-00-00 00:00:00'),
(10, 4, 1, '天秤座', '', '1433930579612673860.jpg', '1433930579682876116.jpg', '天秤座（Libra），出生日期为9月23日-10月23日。位于处女座之东，天蝎座之西，是黄道十二宫的第七宫。', 9, 22, 0, 0, '0000-00-00 00:00:00'),
(11, 4, 1, '天蝎座', '', '1433930747493430768.jpg', '1433930752599459550.jpg', '天蝎座（Scorpio），出生日期为10月24日~11月22日。是十二星座之黄道第八宫，位于天秤座之东，射手座之西。', 9, 12, 0, 0, '0000-00-00 00:00:00'),
(12, 4, 1, '射手座', '', '143393091439948490.jpg', '1433930914189637809.jpg', '射手座（Sagittarius），出生时间是11月23日~12月21日，黄道十二宫之第九宫。在天蝎座之东，摩羯座之西。', 9, 45, 0, 0, '0000-00-00 00:00:00'),
(13, 4, 1, '摩羯座', '', '1433930957343621922.jpg', '1433930957445854162.jpg', '摩羯座（Capricornus），黄道十二宫的第十宫。摩羯座是象征着冬天开始的星座，冬天把绝对意识毫无保留地奉献给了摩羯座出生的人。 ', 9, 25, 0, 0, '0000-00-00 00:00:00'),
(14, 4, 1, '水瓶座', '', '1433931008304864778.jpg', '1433931008356582442.jpg', '水瓶座（Aquarius），日期为1月20日—2月18日，黄道星座之第十一宫。在摩羯座之东，双鱼座之西。', 9, 54, 0, 0, '0000-00-00 00:00:00'),
(15, 4, 1, '双鱼座', '', '1433931068687920572.jpg', '1433931068791600024.jpg', '双鱼座（Pisces），出生日期为2月19日—3月20日，黄道星座之第十二宫。在水瓶座之东，白羊座之西。 ', 9, 11, 0, 0, '0000-00-00 00:00:00'),
